import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Paper2 from "../components/Paper2";


function Leistung2() {
  return (
    <div>
      <Header />
      <Paper2 />
      <Footer />
      <br />
    </div>
  );
}

export default Leistung2;
